<body class="dashboard">

<!-- Container -->

<h1 id="site-name">Django administration</h1>

        </div>
        
        <div id="user-tools">
            Welcome,
            <strong>admin</strong>.
            
                
                
                
                <a href="http://127.0.0.1:8000/admin/password_change/">Change password</a> /
                
                <a href="http://127.0.0.1:8000/admin/logout/">Log out</a>
            
        </div>
        
        
    </div>
    <!-- END Header -->
    
    

    
        
    

    <!-- Content -->
    <div id="content" class="colMS">
        
        <h1>Site administration</h1>
        
<div id="content-main">


    
        <div class="module">
        <table>
        <caption>
            <a href="http://127.0.0.1:8000/admin/auth/" class="section" title="Models in the Auth application">
                Auth
            </a>
        </caption>
        
            <tbody><tr>
            
                <th scope="row"><a href="http://127.0.0.1:8000/admin/auth/group/">Groups</a></th>
            

            
                <td><a href="http://127.0.0.1:8000/admin/auth/group/add/" class="addlink">Add</a></td>
            

            
                <td><a href="http://127.0.0.1:8000/admin/auth/group/" class="changelink">Change</a></td>
            
            </tr>
        
            <tr>
            
                <th scope="row"><a href="http://127.0.0.1:8000/admin/auth/user/">Users</a></th>
            

            
                <td><a href="http://127.0.0.1:8000/admin/auth/user/add/" class="addlink">Add</a></td>
            

            
                <td><a href="http://127.0.0.1:8000/admin/auth/user/" class="changelink">Change</a></td>
            
            </tr>
        
        </tbody></table>
        </div>
    
        <div class="module">
        <table>
        <caption>
            <a href="http://127.0.0.1:8000/admin/sites/" class="section" title="Models in the Sites application">

            </a>
        </caption>
        
            <tbody><tr>
            
                <th scope="row"><a href="http://127.0.0.1:8000/admin/sites/site/">Sites</a></th>
            

            
                <td><a href="http://127.0.0.1:8000/admin/sites/site/add/" class="addlink">Add</a></td>
            

            
                <td><a href="http://127.0.0.1:8000/admin/sites/site/" class="changelink">Change</a></td>
            
            </tr>
        
        </tbody></table>
        </div>
    

</div>
